CREATE DATABASE IF NOT EXISTS employees;
USE employees;

CREATE TABLE departments (dept_no char(4) NOT NULL, dept_name varchar(40) NOT NULL);
CREATE TABLE dept_emp (emp_no int(11) NOT NULL, dept_no char(4) NOT NULL, from_date int(11) NOT NULL, to_date int(11) NOT NULL);
CREATE TABLE dept_manager (emp_no int(11) NOT NULL, dept_no char(4) NOT NULL, from_date int(11) NOT NULL, to_date int(11) NOT NULL);
CREATE TABLE employees (emp_no int(11) NOT NULL, birth_date int(11) NOT NULL, first_name varchar(14) NOT NULL, last_name varchar(16) NOT NULL, gender char(1) NOT NULL, hire_date int(11) NOT NULL);
CREATE TABLE salaries (emp_no int(11) NOT NULL, salary int(11) NOT NULL, from_date int(11) NOT NULL, to_date int(11) NOT NULL);
CREATE TABLE titles (emp_no int(11) NOT NULL, title varchar(50) NOT NULL, from_date int(11) NOT NULL, to_date int(11) DEFAULT NULL);
